INSERT INTO `tyb_record` VALUES ('6', 'tomcat发布项目在浏览器title中的小猫替换', '<ol style=\"list-style-type: decimal;\" class=\" list-paddingleft-2\"><li><p>原始状态：</p></li><ol style=\"list-style-type: lower-alpha;\" class=\" list-paddingleft-2\"><li><p>找到tomcat的安装目录，找到webapps下ROOT文件夹下的favicon.ico，这就是在标题上显示的原始图标。</p></li><li><p>将自己自定义的图标放进来，并改名为favicon.ico，将原来的替换掉即可。</p></li><li><p>重启tomcat服务器，清空浏览器缓存，刷新页面即可。</p></li></ol><li><p>在每个页面引入标签，指定每个页面特定的ico图片：</p><p><img alt=\"Java项目如何替换掉标题上tomcat小猫咪的图标 - 狂奔的蜗牛 - 狂奔的蜗牛\" src=\"/ueditor/jsp/upload/image/20170830/1504065720615037734.jpg\"/></p><p>这样可以在不同的页面指定不同的图片，比较灵活</p></li></ol>');
INSERT INTO `tyb_record` VALUES ('23', '1111', '<p><img src=\"/ueditor/jsp/upload/image/20171017/1508229378035_陶英镖签名.jpg\" title=\"1508229378035_陶英镖签名.jpg\" alt=\"陶英镖签名.jpg\"/><img src=\"/ueditor/jsp/upload/image/20171017/1508229398658_5.jpg\" title=\"1508229398658_5.jpg\" alt=\"5.jpg\"/><img src=\"/ueditor/jsp/upload/image/20171017/1508229410246_3.jpg\" title=\"1508229410246_3.jpg\" alt=\"3.jpg\"/></p>');

